        if c < b:
            b, c = c, b

        if a == b:
            return c - b - 1
        elif b == c:
            return b - a - 1
        else:
            return c - b + 1

    def find_solution(a, b, c):
        if a == b and b % c == 0:
            return a, b, c
        elif b == c:
            return a, b, c
        else:
            return a, b - 1, c

    def find_minimum(cases):
        results = []
        for case in cases:
            a, b, c = map(int, case.split())
            if a == b and b == c:
                results.append(0)
                results.append(f"{a} {b} {c}")
            else:
                min_ops = min_operations(a, b, c)
                if min_ops == float('inf'):
                    results.append(-1)
                    results.append("-1")
                else:
                    a, b, c = find_solution(a, b, c)
                    results.append(min_ops)
                    results.append(f"{a} {b} {c}")
        return results

