    n, s = stdin.split()
    n = int(n)
    s = str(s)

    # Helper function to check if a bracket sequence is regular
    def is_regular(seq):
        stack = []
        for char in seq:
            if char == '(':
                stack.append('(')
            elif char == ')':
                if not stack or stack.pop() != '(':
                    return False
        return not stack

    # Calculate the number of regular bracket sequences of length 2n containing s as a substring
    count = 0
    for i in range(2**(n-1)):
        seq = s + ''.join(['(' if j == '1' else ')' for j in bin(i)[2:].zfill(n-1)])
        if is_regular(seq):
            count += 1

    # Return the result modulo 10^9+7
    return str((count * (2**n)) % (10**9 + 7))

