    def is_divisible_by_25(digits: list) -> bool:
        return sum(digits[::-1]) % 25 == 0

    def swap(digits: list, i: int, j: int) -> list:
        digits[i], digits[j] = digits[j], digits[i]
        return digits

    def move(digits: list, i: int, j: int) -> int:
        if i == 0:
            return 0
        elif i == 1:
            if digits[i] == 0:
                return -1
            else:
                return 1
        else:
            if digits[i] == 0:
                for j in range(i-1, 0, -1):
                    if digits[j] != 0:
                        return move(swap(digits, i-1, j), i-1, j-1) + 1
                return -1
            else:
                return move(digits, i-1, i-2)

    if is_divisible_by_25(digits):
        return str(move(digits, len(digits)-1, len(digits)-2))
    else:
        return "-1"

