    for u, v in edges:
        adj_list[u - 1].append(v - 1)
        adj_list[v - 1].append(u - 1)

    visited = [False] * n
    parent = [-1] * n

    def dfs(u: int, p: int) -> bool:
        visited[u] = True
        for v in adj_list[u]:
            if v == p:
                continue
            if not visited[v]:
                parent[v] = u
                if not dfs(v, u):
                    return False
            elif v != parent[u]:
                return False
        return True

    for u in range(n):
        if not visited[u]:
            if not dfs(u, -1):
                return "NO"

    orientation = ['0'] * m

    def dfs_orientation(u: int, p: int) -> None:
        for v in adj_list[u]:
            if v == p:
                continue
            if v != parent[u]:
                orientation[edges.index((u + 1, v + 1))] = '1'
            dfs_orientation(v, u)

    dfs_orientation(0, -1)
    return "YES" + "\n" + "".join(orientation)


