    def find(parent, i):
        if parent[i] != i:
            parent[i] = find(parent, parent[i])
        return parent[i]

    def union(parent, rank, x, y):
        xroot = find(parent, x)
        yroot = find(parent, y)
        if xroot == yroot:
            return False
        elif rank[xroot] < rank[yroot]:
            parent[xroot] = yroot
        elif rank[xroot] > rank[yroot]:
            parent[yroot] = xroot
        else:
            parent[yroot] = xroot
            rank[xroot] += 1
        return True

    def kruskal(n, edges):
        parent = [i for i in range(n)]
        rank = [0] * n
        mst_cost = 0
        mst_edges = []
        edges.sort(key=lambda x: x[2])

        for edge in edges:
            if union(parent, rank, edge[0] - 1, edge[1] - 1):
                mst_cost += edge[2]
                mst_edges.append(edge)
            if len(mst_edges) == n - 1:
                break

        return mst_cost, mst_edges

    n, m = map(int, stdin.split()[:2])
    edges = []

    for i in range(m):
        u, v, w = map(int, stdin.split()[3 * i: 3 * (i + 1)])
        edges.append((u, v, w))

    initial_cost, initial_mst = kruskal(n, edges)
    min_ops = 0

    for i in range(m):
        u, v, w = edges[i]
        edges_modified = edges[:i] + [(u, v, w + 1), (v, u, w + 1)] + edges[i + 1:]
        modified_cost, modified_mst = kruskal(n, edges_modified)

        if modified_cost == initial_cost and modified_mst != initial_mst:
            min_ops += 1

    return str(min_ops)

