    from collections import deque
    queue = deque([(start_pos, 0)])
    visited = set()

    # Define the directions of movement for Eren
    directions = [(0, 1), (0, -1), (1, 0), (-1, 0)]

    # Define a function to check if the movement is valid
    def is_valid(x, y):
        if 0 <= x < N and 0 <= y < M:
            if grid[x][y] == '1':
                return False
            elif grid[x][y] == 'U' and (x, y) != start_pos:
                return False
            elif grid[x][y] == 'D' and (x, y) != start_pos:
