def solution(stdin: str) -> str:
    n, k = map(int, input().split())
    installation = [list(map(int, input().split())) for _ in range(n)]

    def get_neighbors(x: int, y: int, installation: List[List[int]]) -> List[Tuple[int, int]]:
        directions = [(0, 1), (1, 0), (0, -1), (-1, 0)]
        neighbors = []
        for dx, dy in directions:
            nx, ny = x + dx, y + dy
            if 0 <= nx < len(installation) and 0 <= ny < len(installation[0]):
                neighbors.append((nx, ny))
        return neighbors

    def bfs(start: Tuple[int, int], end: Tuple[int, int], installation: List[List[int]]) -> int:
        queue = deque([(start, 0)])
        visited = set()
        while queue:
            current, distance = queue.popleft()
            if current == end:
                return distance
            if current not in visited:
                visited.add(current)
                for neighbor in get_neighbors(*current, installation):
                    if installation[neighbor[0]][neighbor[1]] in range(1, k + 1):
                        queue.append((neighbor, distance + 1))
        return -1

    min_distance = float('inf')
    for i in range(n):
        for j in range(n):
            start = (i, j)
            for number in range(1, k + 1):
                end = None
                for x in range(n):
                    for y in range(n):
                        if installation[x][y] == number:
                            end = (x, y)
                            break
                    if end:
                        break
                if end:
                    distance = bfs(start, end, installation)
                    if distance != -1:
                        min_distance = min(min_distance, distance)

    return str(min_distance)

